import React from "react";
import { styled } from "@mui/system";
import SubjectsListItem from "./SubjectsListItem";
import { connect } from "react-redux";
import store from "../../../store/store";

const MainContainer = styled("div")({
  flexGrow: 1,
  width: "100%",
});

const SubjectsList = ({ subjects }) => {
  console.log(store.getState().subjects.subjects);
  return (
    <MainContainer>
      {subjects.map((subject) => (
        <SubjectsListItem key={subject.id} name={subject.name} />
      ))}
    </MainContainer>
  );
};

const mapStoreStateToProps = ({ subjects }) => {
  return {
    ...subjects,
  };
};

export default connect(mapStoreStateToProps)(SubjectsList);
